    def __init__(self) -> None:
        super().__init__()
        self.setFont(QFont('Times New Roman', 16, QFont.Cursive))

        self.file_dialog = QFileDialog(self)

        Label(self, QRect(10, 10, 200, 50), 'Installation path', QFont('Century Gothic', 16, QFont.Normal))

        self.installation_path = QLineEdit(self._get_user_login(), self)
        self.installation_path.setGeometry(10, 70, 680, 50)
        self.installation_path.setFont(QFont('Century Gothic', 16, QFont.Normal))

        self.manage_repositories = PushButton(self, QRect(10, 140, 250, 35), 'Manage Repositories', self._set_path)

        Line(self, QFrame.HLine, QRect(0, 130, self.width(), 130))

        Label(self, QRect(10, 200, 400, 50), 'Choose optional features:', QFont('Century Gothic', 16, QFont.Normal))

        self.shortcut_option = CheckBoxOption(self, QRect(20, 245, 250, 50), 'Add a shortcut to the desktop')
        self.default_video_path = QLineEdit(self)
        self.default_video_path.setGeometry(QRect(280, 275, 350, 50))
        self.default_video_path.setText(f'C:/Users/{username}/Desktop/video')
        Label(self, QRect(20, 275, 250, 50), 'Default video download location', QFont('Century Gothic',
                                                                                      14, QFont.Normal))
        self.default_audio_path = QLineEdit(self)
        self.default_audio_path.setGeometry(QRect(280, 330, 350, 50))
        self.default_audio_path.setText(f'C:/Users/{username}/Desktop/audio')
        Label(self, QRect(20, 330, 250, 50), 'Default audio download location', QFont('Century Gothic',
                                                                                      14, QFont.Normal))

        self.install_button = PushButton(self, QRect(430, 395, 250, 35), 'Install', self._install_app)
        self.waiting_window = FinalInstallationWindow()
        self.back_button = PushButton(self, QRect(320, 395, 100, 35), 'Back', self._go_back_to_installer,
                                      QFont('MS Shell Dlg 2', 8))
        self.final_installation = FinalInstallationWindow()

    def _view_installation_path(self) -> str:
        """Shows the QFileDialog and returns the string
        containing the folder that was chosen by user"""
        return self.file_dialog.getExistingDirectory(caption='Choose Directory', directory='C:/Users/')

    def _set_path(self) -> None:
        """Sets the default installation path in the QLineEdit"""
        self.installation_path.setText(self._view_installation_path())

    def _install_app(self) -> None:
        """General function to install the app"""
        App(installation_path=self.installation_path.text(), shortcut=self.shortcut_option.isChecked(),
            video=self.default_video_path.text(), audio=self.default_audio_path.text()).install_app()
        self.close()
        self.final_installation.show()

    def _go_back_to_installer(self) -> None:
        """Closes InstallationWindow and shows the general Installer window"""
        self.close()
        a.show()

    @staticmethod
    def _get_user_login() -> str:
        """Defines the default installation_path"""

        return f'C:/Users/{username}/AppData/Local'


